import React from "react";
import SuggVideo from "./SuggVideo";

class SuggVideoList extends React.Component {
  render() {
    return (
      <div >
        {this.props.videos.map((video) => {
          return <SuggVideo video={video} />;
        })}
      </div>
    );
  }
}

export default SuggVideoList;
